syntax = "proto3";
package test;
option go_package = "github.com/samrketer/grpc-go-react/generator/gen";

enum E {
    A = 0;
    B = 1;
}

message M {
    string secret = 1;
    string nonSecret = 2;
    optional string secretPtr = 3;
    optional string nonSecretPtr = 4;
}

message Ms {
    repeated M data = 1;
}
